['#include <bits/stdc++.h>
using namespace std;

int main()
{
    int t;
    cin>>t;
    while(t--)
    {
        int n;
        cin>>n;
        vector<int> a(n);
        for(auto &x: a)
            cin>>x;
        vector< vector<int> > pref(26, vector<int>(n+1));
        for(int i = 0; i < n; ++i)
        {
            for(int j = 0; j < 26; ++j)
                pref[j][i+1] = pref[j][i];
            ++pref[a[i]-1][i+1];
        }
        int ans = 0;
        for(int i = 0; i < 26; ++i)
            ans = max(ans, pref[i][n-1]);

        for(int l = 0; l < n; ++l)
        {
            for(int r = l; r < n; ++r)
            {
                int cnti = 0, cnto = 0;
                for(int z = 0; z < 26; ++z)
                {
                    cnti = max(cnti, pref[z][r+1]-pref[z][l]);
                    cnto = max(cnto, min(pref[z][l], pref[z][n]-pref[z][r+1])*2);
                }
                ans = max(ans, cnto+cnti);
            }

        }
        cout<<ans<<"\n";
    }
    return 0;
}
']

